import React from 'react'

export default function One() {
    const oneStyle = {
        height: '250px',
        width: '98px',
        boder: '1px solid black',
        backgroundColor: 'grey',
    }
    return (
        <div style ={oneStyle}>
            <div></div>
        </div>
    )
}
